import React, { useEffect, useState } from "react";
import { CategoryModel, bookModel } from "../../Interfaces";
import { BookCard } from ".";

function BookList() {
  const [books, setBooks] = useState<bookModel[]>([]);
  const [categy, setCategory] = useState<CategoryModel[]>([]);

  useEffect(() => {
    fetch("https://blibraryapi.azurewebsites.net/api/Book")
      .then((response) => response.json())
      .then((data) => {
        console.log(data.result[0].bookCategories[0].category.name);
        setBooks(data.result);
        setCategory(data.res)
      });
  }, []);

  return (
    <div className="container row">
      {books.length > 0 &&
        books.map((book, index) => <BookCard book={book} key={index} />)}
    </div>
  );
}

export default BookList;
